import './addtodo.css';
const AddTodo = () => {
    return ( 
        <div className="AddTodo">
        <form>
        <div className="input-container">
            <div className="addtodo-top">
                <div className="addtodo-labels">
                      <div className="addtodo-title" >
                      <div className={'money-bag'} style={
                        {background : 'linear-gradient(135deg, #BBB5E2 0%, #9C92DF 100%)'}
                      }>
                        <img src="icons/mb.png"  />
                      </div>
                     <input type="text" placeholder='Add Todo' />
                    </div>
                </div>
                
                
              </div>
             
              <div className="addtodo-footer">
                <input type='text' placeholder='Add Todo Description'></input>
               {/* <p>Carrot Improves eyesight.</p>  */}
              </div>
              </div>
              <div className='addTodo-btn'>

              
              <img src="icons/black-edit.png" className='edit-btn'></img>
              </div>
              </form>
        </div>
     );
}
 
export default AddTodo;
